import './Expense.css';
import Expensedate from './Expensedate';


const teslim = (props) =>{


    return (
<div className="expense-item">
    
<Expensedate date = {props.date}></Expensedate>
    <div className='expense-item_d'>
    title:{props.title}
    </div>
    Age:{props.age}
    
    status:{props.status}

</div>
    )


}
export default teslim;
